<head>

    <title>Best Personal Website</title>
    <style>
        * { font-family:'Segoe UI', Tahoma, Geneva, Verdana, sans-serif; }
        body {
            padding: 0;
            margin: 0;
        }
        .main-color {
            position: absolute;
            left: 1rem;
            top: 1rem;
        }
        .container {
            padding-block: 1rem;
            background-color: #666595;
            margin: 0;
            width: 100vw;
            height: 100vh;
            display: flex;
            align-items: center;
            justify-content: center;
        }
        .card {
            display: flex;
            justify-content: center;
            align-items: center;
            margin-inline: 1rem;
        }
        .image-frame {
            border-width: 3px;
            border-style: solid;
            border-color: #007bff;
            border-radius: 50%;
            background-color: #ffffff;
            margin-right: 1rem;
            width: 150px;
            height: 150px;
            display: flex;
            overflow: hidden;
            cursor: pointer;
        }
        .first-message { color: #00b3ff }
        .second-message { color: #0084ff }
        .firstname, .lastname {
            background-color: transparent;
            border: 0;
            font-weight: bold;
            outline: none;
            font-size: 1.5rem;
            width: 30%;
        }
    </style>
